import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
import image1 from "./IMG_8470.jpg";
import image2 from "./IMG_8552.jpg";
import image3 from "./CSL_RadarEye_Rev1.png";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `Radar Eye`,
  description: `The eye has it.`,
  date: "2016-03-15T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`I’ve been very interested in 3d printing lately. The R2 Radar Eye is on the top of my list as a 3d printed part candidate.`}</p>
    <p>{`I sent the file to `}<a parentName="p" {...{
        "href": "https://www.instagram.com/hillmanjason/"
      }}>{`Jason Hillman`}</a>{`, a coworker’s brother who built his own delta 3d printer. He graciously accepted the challenge and set up a web cam that I could check on the progress of the 14 hour print. The curvature of the dome fits the print curvature exactly. Thank you, Jason! Next steps for the Radar Eye are bondo, lots of sanding, a base primer for metallics, and the secret sauce blue dome paint.`}</p>
    <img src={image1} alt="radar eye" />
